import React, { useState } from 'react';
import { NavLink } from 'react-router-dom';
import { Menu, X, ChevronDown } from 'lucide-react';

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [activeDropdown, setActiveDropdown] = useState(null);

  const navItems = [
    { name: 'Home', path: '/' },
    { 
      name: 'Products', 
      path: '/products',
      submenu: [
        { name: 'Classic Cars', path: '/category/classic-cars' },
        { name: 'Electronics', path: '/category/electronics' },
        { name: 'Automotive Parts', path: '/automotive-parts' },
        { name: 'AI-Priced Items', path: '/category/ai-priced' }
      ]
    },
    { name: 'Market Analysis', path: '/global-analysis' },
    { name: 'UK Warehouse', path: '/warehouse' },
    { name: 'AI Pricing', path: '/market-dashboard' },
    { name: 'SEO Analyzer', path: '/seo-analyzer' },
    { name: 'Contact', path: '/contact' }
  ];

  const toggleDropdown = (itemName) => {
    if (activeDropdown === itemName) {
      setActiveDropdown(null);
    } else {
      setActiveDropdown(itemName);
    }
  };

  return (
    <nav className="bg-gray-900 text-white shadow-lg sticky top-0 z-50">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex items-center justify-between h-16">
          {/* Desktop Logo & Nav */}
          <div className="flex items-center">
            <div className="flex-shrink-0">
              <NavLink to="/" className="text-xl font-bold text-yellow-400">
                UniDigital
              </NavLink>
            </div>
            
            {/* Desktop Navigation */}
            <div className="hidden md:block ml-10">
              <div className="flex space-x-4">
                {navItems.map((item) => (
                  <div key={item.name} className="relative group">
                    {item.submenu ? (
                      <button
                        onClick={() => toggleDropdown(item.name)}
                        className="flex items-center px-3 py-2 rounded-md text-sm font-medium hover:bg-gray-800 hover:text-yellow-300 transition"
                      >
                        {item.name}
                        <ChevronDown className="ml-1 h-4 w-4" />
                      </button>
                    ) : (
                      <NavLink
                        to={item.path}
                        className={({ isActive }) =>
                          `px-3 py-2 rounded-md text-sm font-medium transition ${
                            isActive 
                              ? 'bg-yellow-600 text-white' 
                              : 'hover:bg-gray-800 hover:text-yellow-300'
                          }`
                        }
                      >
                        {item.name}
                      </NavLink>
                    )}

                    {/* Desktop Dropdown */}
                    {item.submenu && activeDropdown === item.name && (
                      <div className="absolute left-0 mt-2 w-48 bg-gray-800 rounded-md shadow-lg py-1 z-10">
                        {item.submenu.map((subItem) => (
                          <NavLink
                            key={subItem.name}
                            to={subItem.path}
                            className="block px-4 py-2 text-sm hover:bg-gray-700 hover:text-yellow-300"
                            onClick={() => setActiveDropdown(null)}
                          >
                            {subItem.name}
                          </NavLink>
                        ))}
                      </div>
                    )}
                  </div>
                ))}
              </div>
            </div>
          </div>

          {/* Mobile menu button */}
          <div className="md:hidden">
            <button
              onClick={() => setIsOpen(!isOpen)}
              className="inline-flex items-center justify-center p-2 rounded-md text-gray-400 hover:text-white hover:bg-gray-700"
            >
              {isOpen ? <X className="h-6 w-6" /> : <Menu className="h-6 w-6" />}
            </button>
          </div>
        </div>
      </div>

      {/* Mobile Navigation */}
      {isOpen && (
        <div className="md:hidden bg-gray-800">
          <div className="px-2 pt-2 pb-3 space-y-1 sm:px-3">
            {navItems.map((item) => (
              <div key={item.name}>
                {item.submenu ? (
                  <>
                    <button
                      onClick={() => toggleDropdown(item.name)}
                      className="flex justify-between w-full px-3 py-2 rounded-md text-base font-medium hover:bg-gray-700"
                    >
                      {item.name}
                      <ChevronDown className={`h-5 w-5 transition-transform ${
                        activeDropdown === item.name ? 'rotate-180' : ''
                      }`} />
                    </button>
                    
                    {activeDropdown === item.name && (
                      <div className="ml-4 mt-1 space-y-1">
                        {item.submenu.map((subItem) => (
                          <NavLink
                            key={subItem.name}
                            to={subItem.path}
                            className="block px-3 py-2 rounded-md text-base font-medium hover:bg-gray-700"
                            onClick={() => {
                              setIsOpen(false);
                              setActiveDropdown(null);
                            }}
                          >
                            {subItem.name}
                          </NavLink>
                        ))}
                      </div>
                    )}
                  </>
                ) : (
                  <NavLink
                    to={item.path}
                    className={({ isActive }) =>
                      `block px-3 py-2 rounded-md text-base font-medium ${
                        isActive
                          ? 'bg-yellow-600 text-white'
                          : 'hover:bg-gray-700'
                      }`
                    }
                    onClick={() => setIsOpen(false)}
                  >
                    {item.name}
                  </NavLink>
                )}
              </div>
            ))}
          </div>
        </div>
      )}
    </nav>
  );
};

export default Navbar;
